import * as React from 'react';
import { View, Text } from 'react-native';

function AddAnnouncement() {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Text>Add Announcement</Text>
    </View>
  );
}

export default AddAnnouncement;
